import React from 'react'
import { Input } from 'semantic-ui-react'

const SubmitForm = () => {
  return (
    <>
      <Input placeholder='Name' />
      <button className="ui button" type='submit' >Submit score</button>
    </ >
  )
}

export default SubmitForm
